// import './App.css';
import Home from "./Components/Home/Home";
import {BrowserRouter,Routes,Route} from "react";

function App() {
  return (
    <BrowserRouter>
     <div className="App">
      <Routes>
        <Route path="/" element = { <Home /> } />
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
